package main

import (
	"flag"
	"fmt"
	"log"
	"os"
	"runtime"
	"runtime/pprof"
	"sync"

	"github.com/rishabht08/template-miner/pkg/miner"
)

var memprofile = flag.String("memprofile", "", "write memory profile to `file`")

func main() {

	flag.Parse()

	patternMiner, err := miner.NewMiner(nil, "rishab-key", miner.Config{
		RegexMap: map[string]string{
			`(\b\d{1,3}(?:\.\d{1,3}){3}:\d+\s\[\d{2}/[A-Za-z]{3}/\d{4}:\d{2}:\d{2}:\d{2}\.\d{3}\])`: "Ts[T]",
			`(\d{4}-\d{2}-\d{2})`: "date",
			`(\d{2}:\d{2}:\d{2})`: "time",
		},
	})
	if err != nil {
		panic(err)
	}
	defer patternMiner.Close()
	logs := getLogs() // 500 logs
	numWorkers := 5
	batchSize := len(logs) / numWorkers

	var wg sync.WaitGroup
	resultsCh := make(chan miner.MinedTemplate, len(logs)) // buffered to avoid blocking

	for i := 0; i < numWorkers; i++ {
		start := i * batchSize
		end := start + batchSize
		if i == numWorkers-1 {
			end = len(logs) // include remainder in the last batch
		}

		wg.Add(1)
		go func(batch []string) {
			defer wg.Done()
			results := patternMiner.Train(batch)
			for _, res := range results {
				resultsCh <- res
			}
		}(logs[start:end])
	}

	wg.Wait()
	close(resultsCh)

	for res := range resultsCh {
		fmt.Printf("\nOriginal:    %s\nTemplate:    %s\nTemplate ID: %s\nParams:      %v\nTokens:      %v\n",
			res.OriginalLog, res.Template, res.TemplateID, res.Parameters, res.Tokens)
	}

	oneRes, err := patternMiner.Parse(
		"10.224.0.126:39891 [31/Jul/2025:06:19:51.735] app~ otel_collector_grpc_metrics/capture-metrics-grpc-7 0/0/0/185/185 200 133 - - ---- 1114/1114/5/0/0 0/0 {revenium.middleware.io} \"POST rishab-link HTTP/2.0\" 0/0000000000000000/0/0/0 revenium.rishab",
	)

	fmt.Println("\nOne Result: ")

	if err != nil {
		fmt.Println("Error parsing log:", err)
	} else {

		fmt.Printf("\nOriginal:    %s\nTemplate:    %s\nParams:      %v\n",
			oneRes.OriginalLog, oneRes.Template, oneRes.Parameters)
	}

	if *memprofile != "" {
		f, err := os.Create(*memprofile)
		if err != nil {
			log.Fatal("could not create memory profile: ", err)
		}
		defer f.Close()

		// Run garbage collection before capturing
		runtime.GC()

		if err := pprof.WriteHeapProfile(f); err != nil {
			log.Fatal("could not write memory profile: ", err)
		}
	}

	// for _, res := range oneRes {
	// 	fmt.Printf("\nOriginal:    %s\nTemplate:    %s\nParams:      %v\n",
	// 		res.OriginalLog, res.Template, res.Parameters)
	// }

	// logs := []string{
	// 	"2025-07-28 10:15:30 User John logged in from IP 192.168.1.1",
	// 	"2025-07-28 10:16:00 User Alice logged in from IP 192.168.1.2",
	// 	"2025-07-28 10:16:30 Disk /dev/sda1 usage at 90%",
	// 	"2025-07-28 10:17:00 Disk /dev/sda1 usage at 92%",
	// 	"2025-07-28 10:17:30 Disk /dev/sda2 usage at 88%",
	// 	"2025-07-28 10:17:30 Disk /dev/sda2 usage at 36%",
	// }

	// _ = patternMiner.Train(getLogs())
	// for _, res := range results {
	// 	fmt.Printf("\nOriginal:    %s\nTemplate:    %s\nTemplate ID: %s\nParams:      %s\nTokens:    %s\n",
	// 		res.OriginalLog, res.Template, res.TemplateID, res.Parameters, res.Tokens)
	// }

}

